  input: '"TEXT","F3XA","C00160937","The following amendment is in response to FEC
    correspondence dated April 17, 2002.  The pertaining to Line 119 (c) has been
    corrected to show itemized receipts from the Casey for Congress and the Pierson
    for Congress committees.  These items did not electronically itemize in the original
    report.  The amendment also includes a Schedule B to reflect repayment of loans.
    We have also clarified the memo entries for the ASDC to indicate those are Dollars
    for Democrats memo entries. The amendment also includes a memo entry showing a
    total for all un-itemized receipts from ASDC Dollars for Democrats. The memo entries
    indicating State Party Victory Fund now clarify that it is a DNC-State Party Victory
    Fund.  You will note transfers in from the DNC State Party Victory Fund on Schedule
    A Line 12.  Regarding the contribution to the Tim Johnson for South Dakota Committee,
    the amendment reflects two separate contributions for two separate elections,
    one contribution for the primary election and one contribution for the general
    election. The amendment also includes two H1 schedule.  The first reflects the
    administrative ratio and the second a fundraising ratio.  The South Dakota Democratic
    Party is also clarifying the H4 disbursements pertaining to event advertising,
    media consulting, production, ad production and consulting.  Also, not included
    in the letter but discovered during the review is an amendment to un-itemized
    receipts.   In reviewing the un-itemized receipts Line 11 (a)(ii), it was found
    that many receipts were not coded correctly during the data entry process and
    were not included in the final calculation.  The cash on hand now reflects that
    discrepancy."'
